h3. Summary

When workbox is disabled Team Calendars will silently fail. 


h3. Steps to Reproduce (In the case of cloud workbox was already disabled  after the last system restart but the following steps will reproduce the vague errors. No indication as to why workbox was suddenly disabled)
# Install the Team Calendars add-on
# Disable Team Calendars add-on
# Disable workbox add-on. 
# Enable Team calendars. 

h3. Expected Results
Team Calendars would not silently fail with a vague log error that indicates a time out in the UI. 

h3. Actual Results
The below exception is thrown in the xxxxxxx.log file:
{noformat}
@40000000575667192d7e2034 2016-06-07 01:17:51,762 INFO [LandlordServiceAcceptTenantThread] [atlassian.plugin.manager.DefaultPluginManager] broadcastPluginDisabling Disabling com.atlassian.confluence.extra.team-calendars
@400000005756683500f8505c 2016-06-07 01:22:35,016 http-nio-127.127.127.127-12998-exec-2 WARN anonymous 82x21x1 - 127.127.127.127 /instantupgrade [c.a.upm.mac.HostLicenseUpdatedHandlerImpl] UPM-5043 Detected a plugin which is licensed but not installed: com.atlassian.confluence.extra.team-calendar
{noformat}
 
h3. Notes
On startup you get something a little more conclusive if Workbox is disabled but still pretty vague:

{code}
@40000000575667170c5dd32c 2016-06-07 01:17:49,206 ERROR [Spring DM Context Creation Timer] [plugin.osgi.factory.OsgiPlugin] logAndClearOustandingDependencies Plugin 'com.atlassian.confluence.plugins.confluence-mobile-rest' never resolved service '&notificationService' with filter '(objectClass=com.atlassian.mywork.service.LocalNotificationService)'
@40000000575667192da1d8bc 2016-06-07 01:17:51,764 ERROR [LandlordServiceAcceptTenantThread] [plugin.osgi.factory.OsgiPlugin] logAndClearOustandingDependencies Plugin 'com.atlassian.confluence.extra.team-calendars' never resolved service '&notificationService' with filter '(objectClass=com.atlassian.mywork.service.NotificationService)'
@40000000575667bd2fd5cfbc 2016-06-07 01:20:35,801 ERROR [UpmScheduler:thread-2] [plugin.osgi.factory.OsgiPlugin] logAndClearOustandingDependencies Plugin 'com.atlassian.confluence.extra.team-calendars' never resolved service '&notificationService' with filter '(objectClass=com.atlassian.mywork.service.NotificationService)'
{code}

We should handle this more gracefully. If Workbox is required for Team Calendars it should be auto enabled when Team Calendars is enabled. Also we should improve the logging to be more specific if workbox didn't load instead of giving a timeout failure in the UI. 

h3. Workaround 

Enable Workbox add-ons via [Manage Add-ons|https://confluence.atlassian.com/display/AdminJIRAServer071/Managing+add-ons] (System add-ons)

!workbox.png|thumbnail!

Then enable Team Calendars.

h3. Step to reproduce: 
# Create around 100 calendar and having around 10k of restriction setting for the calendar.
# Create the subscription link for each calendar
# Use the calendar client to fire the subscription request to team Calendar frequently.

h3. Current behaviour: 
We can observe that the heap usage on Confluence is having peak on almost each request, which trigger the full GC frequently. 

h3. Root cause: 
From the database record, it seems that team calendar is retrieving the entirety of users and groups that are used to restrict any calendar, rather than just the specific user/groups relevant to the calendar at hand:
{code}
SELECT GROUP_NAME,TYPE,SUB_CALENDAR_ID,ID FROM AO_950DC3_TC_SUBCALS_PRIV_GRP;
SELECT SUB_CALENDAR_ID,TYPE,ID,USER_KEY FROM AO_950DC3_TC_SUBCALS_PRIV_USR;
{code}

h3. Summary
Team Calendar integration with JIRA doesn't work. Team Calendar cannot edit/update JIRA issues. JIRA issues that were updated in JIRA does not get updated in Team Calendar.

h3. Steps to Reproduce
{panel:title=Scenario 1|borderStyle=dashed|borderColor=#ccc|titleBGColor=#b3e6ff|bgColor=#ffffe4}
# Add a JIRA Issue Dates event
# Drag and drop JIRA Issue Dates fail with the following error 
#* In the UI
!Screen Shot 2015-11-11 at 5.37.05 PM.png!
#* In the logs Confluence logs
{code}2015-11-11 20:05:24.106879500 2015-11-11 20:05:24,099 ERROR [ajp-bio-127.0.0.101-8009-exec-67] [common.error.jersey.ThrowableExceptionMapper] toResponse Uncaught exception thrown by REST service: com.atlassian.applinks.api.ApplicationLinkRequest.setRequestContentType(Ljava/lang/String;)Lcom/atlassian/sal/api/net/Request;
2015-11-11 20:05:24.106881500  -- referer: https://mintwireless.atlassian.net/wiki/calendar/mycalendar.action | url: /wiki/rest/calendar-services/1.0/calendar/events.json | userName: sysadmin
2015-11-11 20:05:24.106882500 java.lang.NoSuchMethodError: com.atlassian.applinks.api.ApplicationLinkRequest.setRequestContentType(Ljava/lang/String;)Lcom/atlassian/sal/api/net/Request;
2015-11-11 20:05:24.106892500 	at com.atlassian.confluence.extra.calendar3.calendarstore.DefaultJiraAccessor.updateEventFields(DefaultJiraAccessor.java:443)
{code}
{panel}

{panel:title=Scenario 2|borderStyle=dashed|borderColor=#ccc|titleBGColor=#b3e6ff|bgColor=#ffffe4}
# Create a sprint in JIRA
# Add a new JIRA Agile Sprints event
#* No error message in the UI, calendar event is added without any issues
#* In the logs JIRA logs
{code}
2015-11-12 12:24:14.305489500 2015-11-12 12:24:14,305 ajp-nio-127.0.0.104-8009-exec-20 WARN sysadmin 744x13029x1 kfrgd5 127.0.0.1 /rest/ical/1.0/ical/search/jql/events.ics [c.a.g.customfield.searcher.GhGenericClauseQueryFactory] The 'sprint' clause does not support the <= operator.
{code}
{panel}

{panel:title=Scenario 3|borderStyle=dashed|borderColor=#ccc|titleBGColor=#b3e6ff|bgColor=#ffffe4}
# Edit an issue that is in a Confluence Calendar event from inside JIRA
# Check Calendar event
#* No error message in the UI
#* No error message in the logs
{panel}

h3. Expected Results
Team Calendar should be synced with JIRA

h3. Actual Results
The integration between Team Calendar and JIRA doesn't get updated after the event is added to the Calendar

h3.Workaround
Add a new event, which will get the most updated dates then remove the older event.
